import React from 'react';
import { BrowserRouter as Router } from 'react-router-dom';
import Intro from "./components/Intro/intro";
import Navbar from "./components/NavBar/navbar";

function App() {
  return (
    <Router>
    <div className="App">
      <Navbar />
      <Intro />
    </div>
    </Router>
  );
}

export default App;
